var Mod0 = {"html":"<p><em>Ceci est à l'origine une brève pour une newsletter interne.</em></p>\n<h1 id=\"application-threat-modeling\">Application Threat Modeling</h1>\n<p><em>Qu'est ce qui vous tient éveillé la nuit ? Qui voudrait vous discréditer et voler vos clients ? Si vous attaquez votre application, comment le feriez vous ?</em></p>\n<p>Ce genre de questions qui vous font passer pour un paranoïaque sont pourtant celles à poser lors d'une séance de Threat Modeling !</p>\n<p>Le Threat Modeling, modèle de menace en français, intervient lors de la phase de conception d'une application. L'objectif est d'identifier, communiquer et comprendre les menaces envers l'application et comment les maîtriser.</p>\n<h2 id=\"qui-doit-le-faire\">Qui doit le faire</h2>\n<p>Un représentant de chaque partie prenantes du projet. Oui il faut le client, un commercial, un représantant de l'équipe sécurité et quelqu'un de l'équipe de développement.</p>\n<h2 id=\"les-questions-à-se-poser\">Les questions à se poser</h2>\n<ul>\n<li>Qu'est ce que l'on construit ?</li>\n<li>Que peut-il mal se passer ?</li>\n<li>Que peut on y faire ? (Réduire / Transférer / Éviter / Accepter le risque)</li>\n<li>Est-ce suffisant ?</li>\n</ul>\n<p>Une matrice des risques est un bon moyen de définir les risques à traîter en priorité.</p>\n<p><img src=\"https://s14-eu5.startpage.com/cgi-bin/serveimage?url=https%3A%2F%2Fcdn.business2community.com%2Fwp-content%2Fuploads%2F2019%2F08%2FRisk-Matrix.jpg&sp=83d7db380bd3eac8149fa3c1beb74321&anticache=715992\" alt=\"risk matrix\" /></p>\n<p>Il convient ensuite de se demander:</p>\n<ul>\n<li>Qui va fixer la vulnérabilité</li>\n<li>Quelles seront les conséquences</li>\n<li>Quel est le prix du fix</li>\n</ul>\n<p><strong>Ceci doit être fait avec quelqu'un ayant un pouvoir de décision, ce n'est pas au développeur d'accepter le risque.</strong></p>\n<p>OWASP motto: \"Threat modelling: the sooner the better, but never too late.\"</p>\n<p>Pour aller plus loin:</p>\n<ul>\n<li><a href=\"https://owasp.org/www-project-cheat-sheets/cheatsheets/Threat_Modeling_Cheat_Sheet.html\">OWASP Threat Modeling CheatSheet</a></li>\n<li><a href=\"https://insights.sei.cmu.edu/sei_blog/2018/12/threat-modeling-12-available-methods.html\">Threat Modeling: 12 Available Methods</a></li>\n</ul>","metadata":{"title":"FR 🇫🇷 - Le concept Application Threat Modeling","summary":"Explication du modèle conceptuel de menace","date":"2020-01-31T00:00:00.000Z"},"filename":"fr-app-threat-modeling.md","path":"/Users/alex.labonne/Documents/Code/alexlab/src/routes/writings/posts/fr-app-threat-modeling.md"};

