var Mod1 = {"html":"<h1 id=\"the-frustration-😖\">The frustration 😖</h1>\n<p>This story starts in your (at least mine) favorite code editor: VSCode.<br />\nWhat's great about VSCode is all the tools available to the community to enable you to make your code editor like your own little bubble.</p>\n<p>✨ You can download a tons of <strong>extensions</strong>, add <strong>snippets</strong>, change the layout and of course, change the <strong>theme</strong> ! ✨</p>\n<p>So here was my VSCode:<br />\n<img src=\"/posts/vscode-frustration/um2y9r4qyg2rgo0r7bqc.png\" alt=\"vscode before\" /></p>\n<p>I used Material Theme Palenight High Contrast, really loved the colors but I had one problem:<br />\nHighlight selection was hard to see, when I wanted to quickly select a typo or change a name, I quickly selected the entire word and got frustrated from it.</p>\n<p>Here is it while selecting 'commander' on line 15 with Material Theme Palenight High Contrast:<br />\n<img src=\"/posts/vscode-frustration/highlight-before.png\" alt=\"selecting commander\" /></p>\n<p>Here is it while selecting 'ander' on line 15 with Material Theme Palenight High Contrast:<br />\n<img src=\"/posts/vscode-frustration/highlight-before-ander.png\" alt=\"selecting ander\" /></p>\n<p>As you can \"see\", the difference is very low and it's hard to notice what you are currently selecting. 🧐</p>\n<p>To avoid this, I switched to the High Contrast theme built in VSCode and I know, you might criticize it and saying that your design eyes are bleeding but hey, at least I now can see what I was selecting.</p>\n<p>Here is it while selecting 'commander' on line 15 with the High Contrast Theme:<br />\n<img src=\"/posts/vscode-frustration/hc-commander.png\" alt=\"HC Theme selecting commander\" /></p>\n<p>Here is it while selecting 'ander' on line 15 with the High Contrast Theme:<br />\n<img src=\"/posts/vscode-frustration/hc-ander.png\" alt=\"HC Theme selecting ander\" /></p>\n<p>After a while, you are accustomed to the theme and your eyes stop bleeding don't worry. 🤩</p>\n<p>But what I mainly noticed, was that the High Contrast was very well made to avoid visual conflicts.</p>\n<h1 id=\"the-research-💻\">The research 💻</h1>\n<p>I had my highlight issue fixed but colors where not really my taste. So I looked on the marketplace for a nice theme with a great highlight contrast but couldn't find one that fit my taste.</p>\n<p>Instead, I found an article from <a href=\"https://twitter.com/sarah_edo\">Sarah Drasner</a> on how to <a href=\"https://css-tricks.com/creating-a-vs-code-theme/\">create a VS Code theme</a>.</p>\n<p>Loved this article and so I decided to make my own theme: a nice looking High Contrast Theme.</p>\n<p>So first I had some issues to register as a developer on the Azure DevOps platform.</p>\n<p>So maybe it took me more 20-30 minutes to understand what I needed instead of 5-10min but here I am now, I can publish on it. ⏱</p>\n<p>So if you follow the css-tricks article, you easely find how to generate a theme template and start to create.<br />\nAlso, the VS Code documentation is really well made to customize everything and you can inspect VSCode like a browser, because it's just an Electron app ! 👌</p>\n<p>I wanted my theme High Contrast and I picked the colors on <a href=\"http://colorsafe.co/\">colorsafe.com</a> to have AAA level colors on WCAG Standard. Only one was AA level to make my theme prettier.</p>\n<p>So here is it: <strong>Save Eyes HC Theme</strong>  👁!<br />\n<img src=\"/posts/vscode-frustration/save-eyes-theme.png\" alt=\"Save Eyes HC Theme\" /></p>\n<p>You can find it here on the marketplace: <a href=\"https://marketplace.visualstudio.com/items?itemName=alexlab.save-eyes-hc\">Save Eyes HC Theme</a>.</p>\n<p>And of course, you can see what you are selecting ! 🔥</p>\n<p>Here is it while selecting 'commander' on line 15 with the Save Eyes HC Theme:<br />\n<img src=\"/posts/vscode-frustration/save-eyes-commander.png\" alt=\"Save Eyes HC Theme selecting commander\" /></p>\n<p>Here is it while selecting 'ander' on line 15 with the Save Eyes HC Theme:<br />\n<img src=\"/posts/vscode-frustration/save-eyes-ander.png\" alt=\"Save Eyes HC Theme selecting ander\" /></p>\n<h1 id=\"the-light-theme-💡\">The light theme 💡</h1>\n<p>On a slack channel of my company, I saw a link about the <a href=\"https://tidbits.com/2019/05/31/the-dark-side-of-dark-mode/\">dark side of dark mode</a> where tldr; was: for most of us light themes are better</p>\n<p>Well, I made one and use it now everyday and it's awesome !</p>\n<p>Here is a little preview:<br />\n<img src=\"/posts/vscode-frustration/save-eyes-light.png\" alt=\"Save Eyes Light\" /></p>\n<p>Of course it's on the marketplace: <a href=\"https://marketplace.visualstudio.com/items?itemName=alexlab.save-eyes-light\">Save Eyes Light</a>  👁</p>\n<h1 id=\"contribute-💪\">Contribute 💪</h1>\n<p>Of course a theme is made to be used, improved for the needs.</p>\n<p>If you use it, you may encounter issues in specific cases I didn't encounter so <strong>I would love an issue</strong> so I can fix it, or maybe you know want to tackle it a <strong>made a PR</strong> !</p>\n<p>All repos are available in the theme page on the marketplace !</p>\n<p>And yes, also if you don't like it, I would love to hear why so maybe I can make <em>the theme of your dreams</em> :)</p>\n<p><strong>Happy coding VSCode friends !</strong> 💻✨</p>","metadata":{"title":"VSCode frustration to VSCode love ♥","summary":"Was not happy with VSCode themes, so made my own !","date":"2019-06-22T00:00:00.000Z"},"filename":"vscode-frustration.md","path":"/Users/alex.labonne/Documents/Code/alexlab/src/routes/writings/posts/vscode-frustration.md"};

