var Mod2 = {"html":"<h2 id=\"what-is-wasm\">What is WASM</h2>\n<p>WebAssembly is a low level assembly-like language which provides a compilation target for languages so that they can run on the web.<br />\nIt's an open standard inside the W3C WebAssembly Community Group.</p>\n<h2 id=\"goals\">Goals</h2>\n<ul>\n<li><strong>Fast, efficient and portable</strong>: take advantage of common hardware capabilities</li>\n<li><strong>Readable and debuggable</strong>: have a human-readable text format</li>\n<li><strong>Secure</strong>: run in a sandbox and enforce the browser's same-origin and permissions policies</li>\n<li><strong>Don't break the web</strong>: Designed to work with other web technologies and maintains backwards compatibility</li>\n</ul>\n<h2 id=\"why-wasm\">Why WASM</h2>\n<p>Slow performances when using JavaScript with 3D Games, VR VA, computer vision, image editing…</p>\n<p>High cost of download parsing and compiling very large JS applications (can be a problem with slow internet connections and not high performant devices)</p>\n<h2 id=\"integration-with-the-web-platfom\">Integration with the web platfom</h2>\n<h3 id=\"how-does-it-work\">How does it work</h3>\n<p>The web plaform:<br />\nA VM runs the web app's code (the JS code that powers the app)</p>\n<p>A set of <strong>Web APIs</strong> (DOM CSSDOM WebGl, IndexedDB…) is available to have more features.</p>\n<p>The WASM code is executed in a new VM alongside the JS VM. This VM exports WASM code wrapped by the WebAssembly Javascript API so we use Javascript functions to call WebAssembly in our application.</p>\n<p>JS has complete control over how WASM code is downloaded, compiled and ran; it's like a JS feature for efficiently generating high performance functions.</p>\n<p>The <strong>WebAssembly module</strong> can also import and synchronously call Javascript functions.</p>\n<h2 id=\"key-concepts\">Key concepts</h2>\n<ul>\n<li><p><strong>Module</strong>: A stateless binary, declares imports and exports</p></li>\n<li><p><strong>Memory</strong>: A resizable ArrayBuffer where you can write and read with WASM low-level memory access instructions and is shared between WASM and JS</p></li>\n<li><p><strong>Table</strong>: A resizable typed array of references (for the moment only to functions) that is accessible and mutable from JS and WASM (for safety and portability reasons)</p></li>\n<li><p><strong>Instance</strong>: A Module paired with all the state it uses at runtime including a Memory, Table, and set of imported values. An Instance is like an ES2015 module that has been loaded into a particular global with a particular set of imports.</p></li>\n</ul>\n<h3 id=\"available-languages\">Available languages</h3>\n<p>16 stable languages suitable for a production usage: .Net, C#, C, C++, Go, Rust, AssemblyScript…</p>\n<p>20 unstable but usable: PHP, Python, Javascript, Ruby, Java, Kotlin/Native, …</p>\n<p>11 WIP: Ocaml, Haskell,…</p>\n<h2 id=\"demo-time\">Demo time</h2>\n<p>WebAssembly uses <code>.wasm</code> files but also provide a readable assembly-like file format, the <code>.wat</code> files. <a href=\"https://github.com/mdn/webassembly-examples/blob/master/js-api-examples/simple.wat\">You can see one here</a>.</p>\n<h3 id=\"the-calculator\">The calculator</h3>\n<p>I started by doing a <a href=\"https://alexlab.me/experiments/wasm-calculator\">simple calculator</a> based on a tutorial.</p>\n<p>It's how I understood how it works.</p>\n<p>As you can see, I'm using a <code>go</code> file. that you can find on the <a href=\"https://github.com/imalexlab/alexlab/blob/master/src/routes/experiments/wasm-calculator/_wasm/main.go\">repository here</a>.</p>\n<p>Let's decompose it.</p>\n<p>First as a Go file, you give the file a name to the package, here \"main\".</p>\n<pre><code class=\"go language-go\">package main</code></pre>\n<p>After that, you have your imports, here <code>\"fmt\"</code> (formatted I/O) used to print to the console that \"WASM Go Initialized\". Then we import <code>\"syscall/js\"</code>, the js package that gives access to the WebAssembly host environment.</p>\n<pre><code class=\"go language-go\">import (\n  \"fmt\"\n  \"syscall/js\"\n)</code></pre>\n<p>We have after 4 functions (<code>func</code> in Go). Let's focus first on the <code>main</code> function.</p>\n<pre><code class=\"go language-go\">func main() {\n  c := make(chan struct{}, 0)\n\n  fmt.Println(\"WASM Go Initialized\")\n  // register functions\n  registerCallbacks()\n  &lt;-c\n}</code></pre>\n<p>The line <code>c := make(chan struct{}, 0)</code> will create a channel, allowing us to create a long-running program. If we didn't do that, the program would register the callbacks and immediatly finish.</p>\n<p>Then we print <code>fmt.Println(\"WASM Go Initialized\")</code>. It's just a little check to see if our WASM file is correctly loaded.</p>\n<p>We then call the function <code>registerCallbacks</code>, let's see what is this function.</p>\n<pre><code class=\"go language-go\">func registerCallbacks() {\n  emptyWASMObject := make(map[string]interface{})\n  js.Global().Set(\"WASMGo\", js.ValueOf(emptyWASMObject))\n  js.Global().Get(\"WASMGo\").Set(\"add\", js.FuncOf(add))\n  js.Global().Get(\"WASMGo\").Set(\"subtract\", js.FuncOf(subtract))\n}</code></pre>\n<p>First line will allow us to create an empty object in Javascript. <code>map[string]interface{}</code> is the equivalent of a Javascript object. We will add it to our <code>global</code> object in javascript under the key <code>WASMGo</code>. This implementation avoid overriding existings objects in the Javascript <code>global</code> object. All our functions will be available under the <code>WASMGo</code> object.</p>\n<p>Next we set of function <code>add</code> and <code>subtract</code> to our <code>WASMGO</code> object. Let's see what they do.</p>\n<pre><code class=\"go language-go\">func add(this js.Value, i []js.Value) interface{} {\n  return js.ValueOf(i[0].Int() + i[1].Int())\n}\n\nfunc subtract(this js.Value, i []js.Value) interface{} {\n  return js.ValueOf(i[0].Int() - i[1].Int())\n}</code></pre>\n<p>Ok, you see that both are similar so we will only see the <code>add</code> function.</p>\n<p>The <code>add</code> function get two parameters, <code>this</code> a <code>js.Value</code> equivalent to a Javascript value and <code>i</code> and array of <code>js.Value</code>.</p>\n<p>The <code>this</code> is our <code>this</code> in Javascript.</p>\n<p>We want to return a Javascript value. This value will be the addition of our two elements in our array (we are making them integers to add them).</p>\n<p>But wait, where do you pass the numbers?</p>\n<p>Well now that we have our WebAssembly file (you can compile your Go file with this command <code>GOOS=js GOARCH=wasm go build -o lib.wasm</code> or your favorite compiler).</p>\n<p>Go has features that you don't have in your browser, like the file system. But what if we use it or a library we are using use it?</p>\n<p>Well, we have to mock them. Don't worry! Awesome people already did it, here come the <code>wasm_exec.js</code> file. <a href=\"https://github.com/golang/go/wiki/WebAssembly#getting-started\">You can see how to retrieve it here.</a></p>\n<p>You want to load this file like a normal JS file. You have now to initialize the WebAssembly stream by creating a connection with the WebAssembly VM (remember from <code>How does it work</code> part) and fetching our file.</p>\n<p><a href=\"https://github.com/imalexlab/alexlab/blob/master/src/routes/experiments/wasm-calculator/index.svelte\">You can see how I did here in my <code>svelte</code> file.</a></p>\n<p>When the <code>wasm</code> file is downloaded and the WASM VM connected you can see in your console: \"WASM Go Initialized\". You know can see in the console, we have a <code>WASMGo</code> object in our <code>global</code> object.</p>\n<p>So know it's just pure Javascript:</p>\n<pre><code class=\"javascript language-javascript\">function addValues() {\n  const result = WASMGo.add(1, 2);\n}</code></pre>\n<p>This will return <code>3</code>. You can now plug it to your component like a simple function.</p>\n<h3 id=\"the-identicon-generator\">The Identicon Generator</h3>\n<p>After following a tutorial, I wanted to do something more useful and try to add an already existing Go library to my project.</p>\n<p>I went threw the awesome-golang repo and searched for something not to hard to use as my Go knowledge is very basic but fun.</p>\n<p>I found this library, <a href=\"https://github.com/aofei/cameron\">An avatar generator in Go</a>.</p>\n<p><a href=\"https://alexlab.me/experiments/wasm-identicon/\">So I created an Identicon generator.</a></p>\n<p><a href=\"https://github.com/imalexlab/alexlab/blob/master/src/routes/experiments/wasm-identicon/_wasm/main.go\">You can find my Go implementation here.</a></p>\n<p>I will not explain everything as it's almost the same as the calculator.</p>\n<p>You can see our new function <code>identicon</code>.</p>\n<pre><code class=\"go language-go\">func identicon(this js.Value, i []js.Value) interface{} {\n  array := i[0].String()\n\n  imgIcon := cameron.Identicon(\n    []byte(array),\n    540,\n    60,\n  )\n  buf := bytes.Buffer{}\n  jpeg.Encode(\n    &amp;buf,\n    imgIcon,\n    &amp;jpeg.Options{\n      Quality: 100,\n    },\n  )\n\n  dst := js.Global().Get(\"Uint8Array\").New(len(buf.Bytes()))\n  js.CopyBytesToJS(dst, buf.Bytes())\n\n  return dst\n}</code></pre>\n<p>Ok. Like for our <code>add</code> function, we get from the second parameter the values we are passing in our JS function. Here we pass a string and save it in a very bad named variable <code>array</code>.</p>\n<p>Next, we use the <code>cameron</code> library with the function to generate and Identicon with our value.</p>\n<p>The we want to create a JPEG file of it so we need to create a buffer. We encore our imgIcon to our buffer.</p>\n<p>To create an image of that in our Javascript, we have to create a Uint8Array of the length of the buffer (transformed into Bytes). See that like creating a box for the Javascript that we can then put our image in it.</p>\n<p>Finally, we copy our image in our <code>dst</code>, we put our image in the box to ship to Javascript and return it.</p>\n<p>What are we doing in ou JS file ?</p>\n<p>Let's have a look.</p>\n<pre><code class=\"javascript language-javascript\">function loadIcon() {\n  const buf = WASMGo.identicon('Hello');\n  const blob = new Blob([buf], {\n    type: 'png',\n  });\n  const imgUrl = URL.createObjectURL(blob);\n  const ourImage = document.getElementById('image');\n  ourImage.setAttribute('src', imgUrl);\n}</code></pre>\n<p>We know that the first line do, calling our WASM function with the parameter \"Hello\".</p>\n<p>The response is now our Uint8Array and we create a blob of it with the type <code>png</code>.</p>\n<p>We can now create or URL for our image from our blob and add it to <code>ourImage</code>, the <code>&lt;img&gt;</code> element.</p>\n<h3 id=\"the-extension\">The extension</h3>\n<p>After that I wanted to know if it was possible to do it in a browser extension. Like for the Identicon generator, I used a library to prettify the JSON.</p>\n<p><a href=\"https://github.com/imalexlab/Pretty-JSON\">You can find the extension here fore firefox.</a></p>\n<p>For the moment I compile my Go code with the main Go compiler. However it's shipping a lot of unecessary code. So here come TinyGo. This compiler made me reduce my extension from <strong>638.25 KB</strong> to <strong>244.84 KB</strong>!</p>\n<p>Everything isn't ready yet in TinyGo but if you are stuck feel free to create an issue on their repository and check their website!</p>\n<h2 id=\"but-what-about-not-go\">But what about not Go?</h2>\n<p>I didn't try other languages than Go but I assume it will be pretty much the same as Go.</p>\n<p>You connect to the WASM VM, fetch your file, call functions.</p>\n<p><a href=\"https://webassembly.studio/\">You can see examples here in C and Rust</a></p>\n<h2 id=\"performances\">Performances</h2>\n<p>Javascript may be faster for little arrays because you don't have to call an other file and do the function call and wait for an output.</p>\n<p>However, WebAssembly is faster on heavy calculation. So you should definitly take a look on WebAssembly if you are doing big operation and/or you are creating a big application.</p>\n<p>Native code is faster WebAssembly as you don't have to emulate functionalities on Native</p>\n<h2 id=\"cons\">Cons</h2>\n<p>It's complex to get in as it's still new and the ecosystem pretty small. I can't tell you how happy I was at 3am when I saw the first Identicon on my screen (as mentionned before, I'm pretty new in Go so it was an other layer of difficulty).</p>\n<p>There is no new security flaws as it's sandboxed and can do only what the Javascript can do. However, current JS exploits can be rewritten in WASM, making it harder to catch.</p>\n<h2 id=\"future\">Future</h2>\n<p>It will be possible to call WebAPIs directly from your WASM files so you don't have to use a Javascript bridge, making it even faster!</p>\n<p>It will be possible to load WASM Modules like ES2015 modules (using <code>&lt;script type='module'&gt;</code>)</p>\n<p>WebAssembly will not be only on the browser but also on backend, cloud, IOT! Solutions for this already exists! You can find an article here on <a href=\"https://hacks.mozilla.org/2019/03/standardizing-wasi-a-webassembly-system-interface/\">WASI</a> and <a href=\"https://www.youtube.com/watch?v=oky3FdsTuUM\">here a conference about WebAssembly for IOT from the WebAssembly 2020 Summit</a></p>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>Thanks for reading this! It was big journey for me from 0 to 1 in WebAssembly so I hope this article helped you.</p>\n<p>My apoligize for mistakes hidden in my code or in this article, this was all for personal projects so it's not tested, may not use any code standarts but a great way to learn!</p>\n<p>If you have any questions, feel free to contact me on my Twitter!</p>\n<h2 id=\"links\">Links</h2>\n<p>Here are more links that helped me for this presentation and when coding.</p>\n<p><a href=\"https://github.com/appcypher/awesome-wasm-langs\">https://github.com/appcypher/awesome-wasm-langs</a><br />\n<a href=\"https://developer.mozilla.org/en-US/docs/WebAssembly\">https://developer.mozilla.org/en-US/docs/WebAssembly</a><br />\n<a href=\"https://webassembly.org/\">https://webassembly.org/</a><br />\n<a href=\"https://webassembly.studio/\">https://webassembly.studio/</a><br />\n<a href=\"https://github.com/mdn/webassembly-examples/tree/master/js-api-examples\">https://github.com/mdn/webassembly-examples/tree/master/js-api-examples</a><br />\n<a href=\"https://medium.com/@torch2424/webassembly-is-fast-a-real-world-benchmark-of-webassembly-vs-es6-d85a23f8e193\">https://medium.com/@torch2424/webassembly-is-fast-a-real-world-benchmark-of-webassembly-vs-es6-d85a23f8e193</a><br />\n<a href=\"https://www.usenix.org/system/files/atc19-jangda.pdf\">https://www.usenix.org/system/files/atc19-jangda.pdf</a></p>","metadata":{"title":"A Journey into WebAssembly","summary":"A Journey into WebAssembly","date":"2020-06-02T00:00:00.000Z"},"filename":"webassembly-journey.md","path":"/Users/alex.labonne/Documents/Code/alexlab/src/routes/writings/posts/webassembly-journey.md"};

